import React from "react";

const Showcase = () => {
	return (
		<section id="showcase">
			<div class="container">
				<div class="row justify-content-center">
					<div class="col-6">
						<h2>Bet with confidence.</h2>
					</div>
					<div class="col-6">
						<p>
							We compile odds from all across the betting markets to make sure
							that you can quickly and easily place the best bet.
						</p>
					</div>
				</div>
			</div>
		</section>
	);
};

export default Showcase;
